  "online_nodes" |
  "count" |
  "network_throughput" |
  "discord" |
  "twitter" |
  "arrow" |
  "arrow_left" |
  "arrow_down" |
  "arrow_up" |
  "menu_chat" |
  "menu_network" |
  "menu_mystats" |
  "menu_mynodes" |
  "menu_keys" |
  "menu_docs" |
  "copy" |
  "check" |
  "plus" |
  "gear" |
  "submit"

export function getIcon(iconName: IconName) {
  if (iconName === "spinner") return <IconSpinner/>
  if (iconName === "online_nodes") return <IconOnlineNodes/>
  if (iconName === "count") return <IconCount/>
  if (iconName === "network_throughput") return <IconNetworkThroughput/>
  if (iconName === "discord") return <IconDiscord/>
  if (iconName === "twitter") return <IconTwitter/>
  if (iconName === "arrow") return <IconArrow/>
  if (iconName === "arrow_left") return <IconArrowLeft/>
  if (iconName === "arrow_down") return <IconArrowDown/>
  if (iconName === "arrow_up") return <IconArrowUp/>
  if (iconName === "menu_chat") return <IconMenuChat/>
  if (iconName === "menu_network") return <IconMenuNetwork/>
  if (iconName === "menu_mystats") return <IconMenuMyStats/>
  if (iconName === "menu_mynodes") return <IconMenuMyNodes/>
  if (iconName === "menu_keys") return <IconMenuKeys/>
  if (iconName === "menu_docs") return <IconMenuDocs/>
  if (iconName === "copy") return <IconCopy/>
  if (iconName === "check") return <IconCheck/>
  if (iconName === "plus") return <IconPlus/>
  if (iconName === "gear") return <IconGear/>
  if (iconName === "submit") return <IconSubmit/>
  return <></>
}

